import * as React from 'react';
import NavigationBarPresenter, { Redirect } from './presenter/navigation-bar.presenter';
import { withRouter } from 'react-router-dom';
import { RouteComponentProps } from 'react-router';

interface Props extends RouteComponentProps {
  brandName: string,
  searchBarPlaceHolder?: string,
  redirectLinks?: Redirect[];
}

class NavigationBar extends React.Component<Props> {
  handleBrandClick = (): void => {
    const { history } = this.props;
    history.push('/');
  };

  render(): JSX.Element {
    return <NavigationBarPresenter {...this.props} handleBrandClick={this.handleBrandClick}/>
  }
}

export default withRouter(NavigationBar);

import * as React from 'react';
import { AppBar, Toolbar, Typography, Icon, InputBase, Button, Menu, MenuItem, TextField, Divider } from '@material-ui/core';
import { withStyles, WithStyles } from '@material-ui/core/styles';
import styles from './navigationbar.styles';
import { Link } from 'react-router-dom';

export interface Redirect {
  name: string,
  link: string
}

interface Props extends WithStyles<typeof styles> {
  brandName: string;
  searchBarPlaceHolder?: string;
  redirectLinks?: Redirect[];
  handleBrandClick: () => void;
}

interface State {
  anchorEl?: HTMLElement | null;
  privateKey?: string
}
const NavigationBarPresenter = withStyles(styles)(
  class extends React.Component<Props, State> {
    static defaultProps = {
      searchBarPlaceHolder: 'Search'
    }

    state: Readonly<State> = {
      anchorEl: null,
      privateKey: ''
    };

    handleMenu = (event: React.MouseEvent<HTMLElement>): void => {
      this.setState({ anchorEl: event.currentTarget });
    };

    handleClose = (): void => {
      this.setState({ anchorEl: null });
    };

    handleKeyChange = (event: React.ChangeEvent<HTMLInputElement>): void => {
      this.setState({ privateKey: event.target.value });
    };

    render(): JSX.Element {
      const { brandName, classes, redirectLinks, handleBrandClick } = this.props;
      const { anchorEl } = this.state;
      const open = Boolean(anchorEl);

      return (
        <div>
          <AppBar
            position='static'
            classes={{
              root: classes.appBar
            }}
          >
            <Toolbar className={classes.toolBar}>
              <Typography
                align='center'
                variant='title'
                classes={{
                  root: classes.title
                }}
                onClick={handleBrandClick}
              >
                {brandName}
              </Typography>
              {
                redirectLinks ? 
                redirectLinks.map((link, index) => 
                  <Link key={index} to={link.link} className={classes.link}>
                    <Typography
                      align='center'
                      variant='title'
                      classes={{
                        root: classes.linkText
                      }}
                    >
                      {link.name}
                    </Typography>
                  </Link>
                )
                :
                null
              }
              
              <div className={classes.grow} />
              <div className={classes.search}>
                <div className={classes.searchIcon}>
                  <Icon>searchIcon</Icon>
                </div>
                <InputBase
                  placeholder='Search…'
                  classes={{
                    root: classes.inputRoot,
                    input: classes.inputInput,
                  }}
                />
              </div>
              <div>
                <Button 
                  variant={open ? 'outlined': 'text'} 
                  color='secondary' 
                  className={classes.button}
                  classes={{
                    text: classes.borderText
                  }}
                  aria-owns={open ? 'menu-appbar' : undefined}
                  onClick={this.handleMenu}
                >
                  <Typography variant='title'
                    className={classes.buttonSecondText}
                  >
                    Đã có tài khoản?
                  </Typography> 
                  &nbsp; 
                  <Typography 
                    variant='title'
                    className={classes.buttonPrimaryText}
                  >
                    Đăng nhập
                  </Typography> 
                </Button>
                <Menu
                  id='menu-appbar'
                  classes={{
                    paper: classes.popupMenu
                  }}
                  anchorEl={anchorEl}
                  anchorOrigin={{
                    vertical: 'bottom',
                    horizontal: 'right',
                  }}
                  transformOrigin={{
                    vertical: 'top',
                    horizontal: 'right',
                  }}
                  getContentAnchorEl={null}
                  open={open}
                  onClose={this.handleClose}
                >
                  <MenuItem 
                    className={classes.key}
                    classes={{
                      root: classes.noHoverMenu
                    }}
                  >
                  <TextField
                    id='standard-textarea'
                    label='Private Key'
                    color='secondary'
                    className={classes.textField}
                    margin='normal'
                    onChange={this.handleKeyChange}
                  />
                  </MenuItem>
                  <MenuItem 
                    onClick={this.handleClose}
                    classes={{
                      root: classes.noHoverMenu
                    }}
                    disableRipple={true}
                  >
                    <Button
                      variant='contained'
                      fullWidth={true}
                      color='secondary'
                      className={classes.noCap}
                      
                    >
                      Đăng nhập
                    </Button>
                  </MenuItem>
                  <Divider variant='fullWidth' className={classes.divider}/>
                  <Typography
                    variant='body2'
                    className={classes.newCommer}
                  >
                    Mới gia nhập?
                  </Typography>
                  <MenuItem 
                    onClick={this.handleClose}
                    classes={{
                      root: classes.noHoverMenu
                    }}
                    disableRipple={true}
                  >
                    <Button
                      variant='contained'
                      fullWidth={true}
                      color='primary'
                      className={classes.noCap}
                    >
                      Đăng ký
                    </Button>
                  </MenuItem>
                </Menu>
              </div>
              
            </Toolbar>
          </AppBar>
        </div>
      );
    }
  }
);

export default NavigationBarPresenter;

import { createStyles, Theme } from '@material-ui/core/styles';
import { fade } from '@material-ui/core/styles/colorManipulator';
import { red } from '@material-ui/core/colors';

const styles = (theme: Theme) => createStyles({
  appBar: {
    backgroundColor: '#fff',
    position: 'fixed',
    top: 0
  },
  toolBar: {
    width: '-webkit-fill-available',
    margin: '0 auto',
    [theme.breakpoints.up('md')]: {
      width: '70%'
    },
  },
  title: {
    color: '#66757f',
    fontSize: 32,
    cursor: 'pointer',
    borderBottom: 'solid 1px transparent',
    transition: 'border-color .5s ease-out',
    '&:hover': {
      color: red.A400,
      borderBottomColor: red.A400,
      borderWidth: 2
    }
  },
  grow: {
    flexGrow: 1,
  },
  search: {
    position: 'relative',
    borderRadius: 17,
    backgroundColor: fade('#aaa', 0.15),
    '&:hover': {
      backgroundColor: fade('#aaa', 0.25),
    },
    marginRight: theme.spacing.unit * 2,
    marginLeft: 0,
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      marginLeft: theme.spacing.unit * 3,
      width: 'auto',
      
    },
  },
  searchIcon: {
    width: theme.spacing.unit * 9,
    color: '#66757f',
    height: '100%',
    position: 'absolute',
    pointerEvents: 'none',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  inputRoot: {
    color: '#66757f',
    width: '100%',
  },
  inputInput: {
    paddingTop: theme.spacing.unit,
    paddingRight: theme.spacing.unit,
    paddingBottom: theme.spacing.unit,
    paddingLeft: theme.spacing.unit * 10,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      width: 200,
      '&:focus': {
        width: 280,
        border: '1px solid',
        borderColor: red.A200,
        borderRadius: 17
      },
    },
  },
  buttonSecondText: {
    fontSize: 12,
    color: '#CDD2D5',
    letterSpacing: 2
  },
  buttonPrimaryText: {
    fontSize: 12,
    color: '#66757F',
    letterSpacing: 2
  },
  button: {
    textTransform: 'none',
  },
  borderText: {
    border: '1px solid transparent'
  },
  popupMenu: {
    width: 233
  },
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    marginBottom: theme.spacing.unit * 4,
    width: 200,
  },
  key: {
    height: 48
  },
  newCommer: {
    width: '85%',
    margin: '0 auto',
    marginTop: theme.spacing.unit,
    fontSize: 12,
    color: '#66757F'
  },
  noCap: {
    textTransform: 'none',
  },
  divider: {
    marginTop: theme.spacing.unit
  },
  link: {
    textDecoration: 'none',
    marginLeft: theme.spacing.unit * 5
  },
  linkText: {
    color: '#66757f',
    fontSize: 22,
    cursor: 'pointer',
    borderBottom: 'solid 1px transparent',
    transition: 'border-color .5s ease-out',
    '&:hover': {
      color: red.A400,
      borderBottomColor: red.A400,
      borderWidth: 2
    }
  },
  noHoverMenu: {
    '&:hover': {
      backgroundColor: 'transparent'
    }
  }
});

export default styles;

